import React from "react";


const CreateNote = () => {
    return (
        <>
            <form className="text-center">
                <div>
                    <input className="" type="text" placeholder="Title" />
                </div>
                <div>
                    <textarea className="border-0 " placeholder="Enter text" rows="500" column="500" />
                </div>
            </form>
        </>
    )
}
export default CreateNote;
